const toEuler = (x:number,y:number,z:number,angle:number):[number,number,number]=> {
    const s=Math.sin(angle);
    const c=Math.cos(angle);
    const t=1-c;

    let heading:number, attitude:number, bank:number;

    //  if axis is not already normalised then uncomment this
    // double magnitude = Math.sqrt(x*x + y*y + z*z);
    // if (magnitude==0) throw error;
    // x /= magnitude;
    // y /= magnitude;
    // z /= magnitude;
    if ((x*y*t + z*s) > 0.998) { // north pole singularity detected
        heading = 2*Math.atan2(x*Math.sin(angle/2),Math.cos(angle/2));
        attitude = Math.PI/2;
        bank = 0;
        return [bank,attitude,heading];
    }
    if ((x*y*t + z*s) < -0.998) { // south pole singularity detected
        heading = -2*Math.atan2(x*Math.sin(angle/2),Math.cos(angle/2));
        attitude = -Math.PI/2;
        bank = 0;
        return [bank,attitude,heading];
    }
    heading = Math.atan2(y * s- x * z * t , 1 - (y*y+ z*z ) * t);
    attitude = Math.asin(x * y * t + z * s) ;
    bank = Math.atan2(x * s - y * z * t , 1 - (x*x + z*z) * t);
    return [bank,attitude,heading];
};

interface IFace {
    texCoordIndex:number[];
    coordIndex:number[];
}

interface IModelParams {
    faces:IFace[];
    coordinate:number[];
    normal:number[];
    textureCoordinate:Optional<number[]>;
    diffuseColor:Optional<number[]>;
}

export class X3dParser {

    private static readNumericVector(el:XmlNode,attrName:string,size:number,required:boolean = true):number[] {
        const value:string = el.getAttribute(attrName);
        if (!value) {
            if (required) throw new DebugError(`${attrName} is required`);
            else return undefined!;
        }
        const res:number[] =  value.split(' ').map(it=>it.trim()).filter(it=>it.length>0).map(it => Number(it));
        if (size!==Infinity && res.length!==size) {
            throw new DebugError(`wrong attribute value: ${attrName}, ${value}, expected length of array: ${size}`);
        }
        for (const n of res) {
            if (Number.isNaN(n)) {
                throw new DebugError(`wrong numeric value for attribute ${attrName}, ${value}`);
            }
        }
        return res;
    }

    private static getVertex3ByIndex(arr:number[], index:number):[number,number,number]{
        const result:[number,number,number] = [
            arr[index*3],
            arr[index*3+1],
            arr[index*3+2],
        ];
        if (result[0]===undefined || result[1]===undefined || result[2]===undefined) {
            throw new DebugError(`wrong coordinate by index`);
        }
        return result;
    }

    private createMeshModel(params:IModelParams):RenderableModel {
        const pr:ObjPrimitive = new ObjPrimitive();
        pr.vertexColorArr = [];
        const model3d:Model3d = new Model3d(this.game,pr);
        if (params.diffuseColor!==undefined) {
            model3d.fillColor = new Color(
                ~~(params.diffuseColor[0]*255) as byte,
                ~~(params.diffuseColor[0]*255) as byte,
                ~~(params.diffuseColor[0]*255) as byte,
            );
        }

        for (const face of params.faces) {
            if (face.coordIndex.length!==face.texCoordIndex.length) {
                throw new DebugError(`inappropriate coordIndex and texCoordIndex for face`);
            }
            if (face.coordIndex.length===3) { // triangle

                pr.vertexArr.push(
                    ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[0]),
                    ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[1]),
                    ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[2]),
                );
                pr.normalArr!.push(
                    ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[0]),
                    ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[1]),
                    ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[2]),
                );
            }
            else if (face.coordIndex.length===4) { // quad
                const [x0,y0,z0] = X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[0]);
                const [x1,y1,z1] = X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[1]);
                const [x2,y2,z2] = X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[2]);
                const [x3,y3,z3] = X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[3]);

                const [nx0,ny0,nz0] = X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[0]);
                const [nx1,ny1,nz1] = X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[1]);
                const [nx2,ny2,nz2] = X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[2]);
                const [nx3,ny3,nz3] = X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[3]);

                pr.vertexArr.push(x0,y0,z0,x1,y1,z1,x2,y2,z2);
                pr.vertexArr.push(x0,y0,z0,x2,y2,z2,x3,y3,z3);

                pr.normalArr!.push(nx0,ny0,nz0,nx1,ny1,nz1,nx2,ny2,nz2);
                pr.normalArr!.push(nx0,ny0,nz0,nx2,ny2,nz2,nx3,ny3,nz3);

            } else { //fan

                pr.vertexArr.push(
                    ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[0]),
                    ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[1]),
                    ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[2]),
                );
                pr.normalArr!.push(
                    ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[0]),
                    ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[1]),
                    ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[2]),
                );

                for (let i:number=2;i<face.coordIndex.length-1;i++) {
                    pr.vertexArr.push(
                        ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[0]),
                        ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[i]),
                        ...X3dParser.getVertex3ByIndex(params.coordinate,face.coordIndex[i+1]),
                    );
                    pr.normalArr!.push(
                        ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[0]),
                        ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[i]),
                        ...X3dParser.getVertex3ByIndex(params.normal,face.coordIndex[i+1]),
                    );
                }
            }
        }

        if (!pr.indexArr!.length) pr.indexArr = undefined;
        if (!pr.texCoordArr!.length) pr.texCoordArr = undefined;
        if (!pr.normalArr!.length) pr.normalArr = undefined;
        if (!pr.vertexColorArr!.length) pr.vertexColorArr = undefined;

        const wrapper = new SimpleGameObjectContainer(this.game);
        //wrapper.angle3d.x=-Math.PI/2;
        wrapper.appendChild(model3d);
        return wrapper;
    }

    private parseNode(node:XmlNode,model:RenderableModel):void {
        let childModel:RenderableModel = model;
        switch (node.tagName) {
            case 'Transform': {
                const [x,y,z] = X3dParser.readNumericVector(node,'translation',3);
                const [scaleX,scaleY,scaleZ] = X3dParser.readNumericVector(node,'scale',3);
                const rotation:number[] = X3dParser.readNumericVector(node,'rotation',4);

                const translationTransformContainer = new SimpleGameObjectContainer(this.game);
                translationTransformContainer.pos.setXYZ(x,y,z);

                const rotationTransformContainer = new SimpleGameObjectContainer(this.game);
                const euler = toEuler(rotation[0],rotation[1],rotation[2],rotation[3]);
                rotationTransformContainer.angle3d.x = euler[0];
                rotationTransformContainer.angle3d.y = euler[1];
                rotationTransformContainer.angle3d.z = euler[2];
                translationTransformContainer.appendChild(rotationTransformContainer);

                const scaleTransformContainer = new SimpleGameObjectContainer(this.game);
                scaleTransformContainer.scale.setXYZ(scaleX,scaleY,scaleZ);
                rotationTransformContainer.appendChild(scaleTransformContainer);


                translationTransformContainer.id = node.getAttribute('DEF');
                model.appendChild(translationTransformContainer);
                childModel = scaleTransformContainer;
                break;
            }
            case 'Group': {
                childModel = new SimpleGameObjectContainer(this.game);
                childModel.id = node.getAttribute('DEF');
                model.appendChild(childModel);
                break;
            }
            case 'Shape': {
                const indexedFaceSetNode = node.getChildNodes().find(it=>it.tagName==='IndexedFaceSet');
                if (!indexedFaceSetNode) {
                    console.warn('shape without IndexedFaceSet node');
                    break;
                }
                if (indexedFaceSetNode.getAttribute('normalPerVertex')!=='true') {
                    //throw new DebugError(`unsupported normalPerVertex attribute for IndexedFaceSet node`);
                }
                const texCoordIndex:number[] = X3dParser.readNumericVector(indexedFaceSetNode,'texCoordIndex',Infinity);
                const coordIndex:number[] = X3dParser.readNumericVector(indexedFaceSetNode,'coordIndex',Infinity);

                const coordinateNode = indexedFaceSetNode.getChildNodes().find(it=>it.tagName==='Coordinate');
                if (!coordinateNode) {
                    console.warn('shape without Coordinate node');
                    break;
                }
                const normalNode = indexedFaceSetNode.getChildNodes().find(it=>it.tagName==='Normal');
                if (!normalNode) {
                    console.warn('shape without Normal node');
                    break;
                }
                const textureCoordinateNode = indexedFaceSetNode.getChildNodes().find(it=>it.tagName==='TextureCoordinate');

                const coordinate:number[] = X3dParser.readNumericVector(coordinateNode,'point',Infinity);
                const normal:number[] = X3dParser.readNumericVector(normalNode,'vector',Infinity);
                const textureCoordinate:Optional<number[]> =
                    textureCoordinateNode?
                        X3dParser.readNumericVector(textureCoordinateNode,'point',Infinity):
                        undefined;

                if (coordIndex.length!==texCoordIndex.length) {
                    throw new DebugError(`inappropriate length for coordIndex and texCoordIndex array`);
                }
                const faces:IFace[] = [];
                faces.push({
                    texCoordIndex:[],
                    coordIndex:[],
                });
                for (let i:number=0;i<coordIndex.length;i++) {
                    if (coordIndex[i]===-1) {
                        if (texCoordIndex[i]!==-1) throw new DebugError(`inappropriate face for coordIndex and texCoordIndex`);
                        if (i!==coordIndex.length-1) {
                            faces.push({
                                texCoordIndex:[],
                                coordIndex:[],
                            });
                        }
                        continue;
                    }
                    faces[faces.length-1].coordIndex.push(coordIndex[i]);
                    faces[faces.length-1].texCoordIndex.push(texCoordIndex[i]);
                }

                let diffuseColor:Optional<number[]>;
                const appearanceNode = node.getChildNodes().find(it=>it.tagName==='Appearance');
                if (appearanceNode!==undefined) {
                    const materialNode = appearanceNode.getChildNodes().find(it=>it.tagName==='Material');
                    if (materialNode!==undefined) {
                        diffuseColor = X3dParser.readNumericVector(materialNode,'diffuseColor',Infinity,false);
                    }
                }

                childModel = this.createMeshModel({
                    coordinate,
                    faces,
                    normal,
                    textureCoordinate,
                    diffuseColor,
                });
                model.appendChild(childModel);
                break;
            }
            default: {
            }
        }
        node.getChildNodes().forEach(childNode=>{
            this.parseNode(childNode,childModel);
        });
    }

    public constructor(private game:Game) {
    }

    public parse(doc:XmlDocument):RenderableModel {
        const root = new SimpleGameObjectContainer(this.game);
        this.parseNode(doc,root);
        return root;
    }

}


